import React from 'react';

export default function Contact() {
    return (
        <div className='display-component'>
            <ul style={{ border: "solid 1px" }}>
                <li>
                    <h2>Wood Department</h2>
                    <p>888-852-1822</p>
                </li>

                <li>
                    <h2>Rock Department</h2>
                    <p>888-172-2918</p>
                </li>

                <li>
                    <h2>Metal Department</h2>
                    <p>888-091-7840</p>
                </li>
            </ul>
        </div>
    );
};
